import React from 'react'
import "./Feed.css"
import StoryReel from './StoryReel'
import MessageSender from './MessageSender';
import Post from './Post'
import {Avatar} from '@material-ui/core';
function Feed() {
    return (
        <div className='feed'>
            <StoryReel />
            <MessageSender />

            <Post 
                profilePic=""
            />
        </div>
    )
}

export default Feed
